    "Organchlorine compounds in pallid sturgeon",nt"tracking_summary": {ntt"total":
    7,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2014-04-24T15:03:38.174470",nt"name": "organchlorine-compounds-in-pallid-sturgeon",nt"isopen":
    false,nt"url": null,nt"notes": "Pallid sturgeon, a federally endangered
    species, are extremely rare, and few specimens are available for study. We obtained
    12 Mississippi River pallid sturgeon for study; 3 near Chester., Illinois, and 9
    from Louisiana. The closely related shovelnose sturgeon is more abundant than the
    pallid sturgeon and could possibly be used as a surrogate study species. Pallid
    sturgeon propagation techniques will have to be further developed for reintroduction
    purposes. The objectives of the study were to identify reproductive characteristics
    in pallid sturgeon and shovelnose sturgeon that could contribute to information
    needed for artificial propagation and to identify reproductive similarities between
    the two species. The principal results reported in the study are on fecundity, level
    at maturity for males and females, and information relating egg diameter and gonadal
    somatic indices to maturity stage for both pallid and shovelnose sturgeons. The
    decline in pallid sturgeon numbers as the relate to habitat losses on the Missouri
    River is reviewed and discussed.",nt"license_title": "License Not Specified",nt"extras":
